import { StyleSheet,Dimensions} from 'react-native';
const userComponentStyles = StyleSheet.create({
  div:{
    backgroundColor: '#000',
    padding:10,
    margin:10,
    borderRadius:15,
    paddingRight:20,
    width:Dimensions.get('window').width - 40,
    opacity:0.80
  },
  text:{
    //color:'#1e2833',
    color:'#fff',
    paddingLeft:15,
  },
  nevek:{
   // color:'#1e2833',
    color:'#fff',
    fontWeight: "bold",
    textAlign:"center",
    paddingBottom:5,
    fontSize:16
  },
  icons:{
    fontSize:15,
    //color:'#1e2833',
    color:'#fff',
  }
});
export {userComponentStyles};
